window.bookSummaryJSON = "<p>This audio novella is a stand-alone prequel to the Cormac Reilly series. </p> <p>Twenty-two-year-old Niamh Turley thought she had problems dealing with the obnoxious principal of the school she’s teaching in as well as the anxious parents of her little charges, but when she wakes one morning to a missing roommate and a garda knocking on her door, her life spirals out of control fast.... </p>"; 
